 import React, { Component } from 'react';
// import Todos from './components/Todos';
import './App.css';

function App() {

  const name = 'Brad'
  const x = false
  function getTimeOfDay() {
    var d = new Date();
    return d.getTime();
  }

  return (
    <div className='App'>
      <h1>Hello From React</h1>
      <h2>{getTimeOfDay()}</h2>
    </div>
  )
}

export default App;
